const handleLogout = async () => {
  try {
    await AsyncStorage.clear();
    navigation.dispatch(
      CommonActions.reset({
        index: 0,
        routes: [{ name: "Login" }],
      })
    );
    setIsLoggedIn(false);
  } catch (error) {
    console.error("Error during logout:", error);
  }
};
